//   return (
//     <div className="DeleteProductDiv ManagerForms">
//       <form className="DeleteProductForm FormContent">
//         <label>קטגוריה</label>
//         <input type="text" className="input" />
//         <label>תת קטגוריה</label>
//         <input type="text" className="input" />
//         <label>שם מוצר</label>
//         <input type="text" className="input" />
//       </form>
//     </div>
//   );
// }

export function OtherForm() {


  useEffect(() => {
    GetAllUsers().then((res) => {
      for (var i = 0; i < res.length; i++) {
        ListUsers[i] = res[i];
      }
      console.log(ListUsers);
    });
    console.log(ListUsers);
  });
  return (
    <>
      <div className="AddProductDiv ManagerForms">
        <div className="backgroundGradient">
          <form className="AddProductForm FormContent">
            <div className="row">
              <div className="col">
                <Autocomplete
                  id="free-solo-demo"
                  freeSolo
                  options={ListUsers.map(
                    (option) => option.FirstNameUser + option.LastNameUser
                  )}
                  renderInput={(params) => (
                    <TextField
                      {...params}
                      label="freeSolo"
                      margin="normal"
                      variant="outlined"
                    />
                  )}
                />
              </div>
              <div className="col"></div>
            </div>
          </form>
        </div>
      </div>
    </>
  );
}
